contracts/ThreatAnalysis.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";

contract ThreatAnalysis is Ownable, Pausable {
    struct Analysis {
        string threatId;
        string title;
        string description;
        string severity;
        uint256 confidence;
        bool verified;
        string aiSummary;
        uint256 timestamp;
        string[] indicators;
        string[] recommendations;
    }

    // Mapping from threat ID to Analysis
    mapping(string => Analysis) public analyses;
    
    // Array to keep track of all threat IDs
    string[] public threatIds;
    
    // Events
    event AnalysisAdded(string threatId, string title, uint256 timestamp);
    event AnalysisVerified(string threatId, bool verified);
    event AnalysisUpdated(string threatId, uint256 timestamp);

    constructor() {
        _pause(); // Start paused for safety
    }

    function addAnalysis(
        string memory threatId,
        string memory title,
        string memory description,
        string memory severity,
        uint256 confidence,
        string memory aiSummary,
        string[] memory indicators,
        string[] memory recommendations
    ) public whenNotPaused onlyOwner {
        require(bytes(threatId).length > 0, "Threat ID cannot be empty");
        require(bytes(title).length > 0, "Title cannot be empty");
        
        analyses[threatId] = Analysis({
            threatId: threatId,
            title: title,
            description: description,
            severity: severity,
            confidence: confidence,
            verified: false,
            aiSummary: aiSummary,
            timestamp: block.timestamp,
            indicators: indicators,
            recommendations: recommendations
        });
        
        threatIds.push(threatId);
        
        emit AnalysisAdded(threatId, title, block.timestamp);
    }

    function verifyAnalysis(string memory threatId, bool verified) public whenNotPaused onlyOwner {
        require(bytes(analyses[threatId].threatId).length > 0, "Analysis does not exist");
        
        analyses[threatId].verified = verified;
        
        emit AnalysisVerified(threatId, verified);
    }

    function getAnalysis(string memory threatId) public view returns (
        string memory title,
        string memory description,
        string memory severity,
        uint256 confidence,
        bool verified,
        string memory aiSummary,
        uint256 timestamp,
        string[] memory indicators,
        string[] memory recommendations
    ) {
        Analysis storage analysis = analyses[threatId];
        require(bytes(analysis.threatId).length > 0, "Analysis does not exist");
        
        return (
            analysis.title,
            analysis.description,
            analysis.severity,
            analysis.confidence,
            analysis.verified,
            analysis.aiSummary,
            analysis.timestamp,
            analysis.indicators,
            analysis.recommendations
        );
    }

    function getAllThreatIds() public view returns (string[] memory) {
        return threatIds;
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }
}

